import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { Box } from '@mui/material';
import Layout from './components/Layout/Layout';
import Dashboard from './pages/Dashboard/Dashboard';
import Search from './pages/Search/Search';
import Reports from './pages/Reports/Reports';
import Upload from './pages/Upload/Upload';
import Drivers from './pages/Drivers/Drivers';
import Vehicles from './pages/Vehicles/Vehicles';
import Fatigue from './pages/Fatigue/Fatigue';
import Alerts from './pages/Alerts/Alerts';

function App() {
  return (
    <Box sx={{ display: 'flex', minHeight: '100vh' }}>
      <Layout>
        <Routes>
          {/* üè† Dashboard Principal */}
          <Route path="/" element={<Navigate to="/dashboard" replace />} />
          <Route path="/dashboard" element={<Dashboard />} />
          
          {/* üîç B√∫squeda y Filtros */}
          <Route path="/search" element={<Search />} />
          
          {/* üë®‚Äçüíº Gesti√≥n de Conductores */}
          <Route path="/drivers" element={<Drivers />} />
          <Route path="/drivers/:driverId" element={<Drivers />} />
          
          {/* üöó Gesti√≥n de Veh√≠culos */}
          <Route path="/vehicles" element={<Vehicles />} />
          <Route path="/vehicles/:placa" element={<Vehicles />} />
          
          {/* üö® An√°lisis de Fatiga */}
          <Route path="/fatigue" element={<Fatigue />} />
          
          {/* üîî Alertas y Notificaciones */}
          <Route path="/alerts" element={<Alerts />} />
          
          {/* üìä Reportes y An√°lisis */}
          <Route path="/reports" element={<Reports />} />
          
          {/* üì§ Carga de Archivos */}
          <Route path="/upload" element={<Upload />} />
          
          {/* 404 - P√°gina no encontrada */}
          <Route path="*" element={<Navigate to="/dashboard" replace />} />
        </Routes>
      </Layout>
    </Box>
  );
}

export default App;
